import React from 'react';
import { useParams,Link  } from 'react-router-dom';
import tourData from '../DB/Tuscany.json';
// import TuscanySlider from '../components/Carousel/TuscanyCarousel';
import BookingDetails from './Purchase/BookingDetails';

export default function SpecificTour() {
  const { id } = useParams(); 



  const tour = tourData.find((tour) => tour.id === parseInt(id));

  
  return (
    <section>
      <section className="tour" key={tour.id}>
        <h2>{tour.title}</h2> 
        <p> from </p> <p><strong>Price:</strong> {tour.price} â‚¬</p>
      <section>

      </section>
<MainGallery/>
        <p>{tour.short_description}</p>
        <section>
        {/* <Datepicker/>
        <TimePicker/> */}
        {/* <Link to={<BookingDetails/>}>
        <button> Buy Now</button>
        </Link>
         */}
<section>
          <section className='step'>
            1
            <span> Booking details </span>
          </section>
          <progress min={30} max={100}>
          </progress>
          <section>
            2
            <span> User</span>
          </section>
          <progress value={60}></progress>
          
</section>
       <h3>Details</h3>
        <p>{tourData.details}</p>
        <img/> <h3> Number of group: {tour.people}</h3>
        <img/> <h3><strong>Duration:</strong> {tour.duration}</h3>   
        <img/> <h3> Departuring and arriving areas: {tour.departure}</h3>
        <img/> <h3> Guide service:{tour.guide}</h3>
        <img/> <h3>Language:{tour.language}</h3>
        <img/> <h3>Entry Fees:{tour.fees} </h3>
        <img/>  <h3> EntryTransportation:{tour.transport}</h3>
             </section>

      </section>
<GalleryPlaces/>
    {/* <TuscanySlider/> */}
    </section>
  );
}

export const GalleryPlaces = () => {
  const { id } = useParams(); 

    const gallery = tourData.find((gallery) => gallery.id === parseInt(id));
const { img1, img2, img3, img4 } = gallery;


return(
 
  
    <section key={gallery.id}>
      <img src={gallery.img4} alt="place's image 1" />
      <img src={gallery.img5} alt="place's image 2" />
      <img src={gallery.img6} alt="place's image 3" />
      <img src={gallery.img7} alt="place's image 4" />
    </section>
  
)
}

export const MainGallery = () => {
  const { id } = useParams(); 

  const gallery = tourData.find((gallery) => gallery.id === parseInt(id));
  return(
    
    <section key={gallery.id}>
    <img src={gallery.img}/>
    <img src={gallery.img1} />
    <img src={gallery.img2} />
    <img src={gallery.img3} />
    </section>

  )
}
